import com.google.common.collect.Range;
import com.google.common.collect.RangeMap;
import com.google.common.collect.TreeRangeMap;
import java.util.HashMap;
import java.util.Map;

public class Main {
    public static void main(String[] args) {
        RangeMap<Integer, String> rangeMap = TreeRangeMap.create();
        Map<String, Integer> sampleMap = new HashMap<>();

        // Working with a sample HashMap
        sampleMap.put("Key1", 100);
        sampleMap.put("Key2", 200);
        int sum = 0;
        for (Map.Entry<String, Integer> entry : sampleMap.entrySet()) {
            sum += entry.getValue();
        }
        System.out.println("Sum of values in sampleMap: " + sum);

        // Additional operations with RangeMap
        rangeMap.put(Range.closed(20, 30), "Value2");
        rangeMap.put(Range.open(30, 40), "Value3");

        // Some unrelated computations
        int[] numbers = {1, 2, 3, 4, 5};
        int total = 0;
        for (int number : numbers) {
            total += number;
        }
        System.out.println("Total sum of numbers array: " + total);

        // Original write operation
        /* write */ rangeMap.put(Range.closed(1, 10), "Value1");

        // More computations
        for (int i = 0; i < 5; i++) {
            System.out.println("Number: " + numbers[i]);
        }

        // Original read operation
        /* read */ String value = rangeMap.get(5);
        System.out.println("Value from RangeMap: " + value);

        // Further manipulation of the sampleMap
        sampleMap.put("Key3", 300);
        if (sampleMap.containsKey("Key3")) {
            System.out.println("Key3 exists with value: " + sampleMap.get("Key3"));
        }
    }
}
